import React from 'react';
import { API } from '../config';

 const ShowImage2 = ({ item, url }) => {
   return (
  <div className="product-img2" style={{ height: "250px" }}>
     
      
    <img
      src={`${API}/${url}/image/${item._id}`}
      alt
      className="mb-3"
      style={{
        objectFit: "contain",
        height: "100%",
        width: "100%",
        display: "flex",
        flexDirection: "row",
        marginLeft: "auto",
        marginRight: "auto",
      }}
    />
    </div>
    
    
)
    }
export default ShowImage2
